E_D("replace into `phome_ecms_game` values('4812','14','0','','','','1','admin','','1','0','1343236825','0','0','0','0','','','4812','0','0','0','0','0','0','月亮耙耙','1343236825','/spic/20120725/6737.jpg','0','1','1343236825','0','3','1','0','','0','','/d/file/swf/7101.swf','667','479','肚里坐个爹爹，爹爹出来买菜，<br />肚里坐个奶奶，奶奶出来绣花，<br />绣扎糍粑，糍粑跌得井里，<br />变扎蛤蟆，蛤蟆伸脚，<br />变扎喜鹊，喜鹊上树，<br />变扎斑鸠，斑鸠咕咕咕……<br />----<br />寒星点点眨眼睛，<br />月到中秋分外明，<br />站在水边看月亮，<br />月亮下面是故乡。<br />月光揉在江水里，<br />想起爷爷的声音。<br />今年天气冷得早，<br />秋风清清扰我心。<br />-<br />月亮月亮我问你，<br />今年你多大年纪？<br />明天我会在哪里？<br />什么时候我已长大了，<br />你却依然很平静？<br />----<br />故事一年又一年，<br />(故事一年又一年)<br />思念一天又一天，<br />(思念一天啊)<br />远方的人你是否，<br />(你是否)<br />依然儿时的容颜。','1','','0','','1','/dpic/20120725/6738.jpg','7101','VERKT2RtSlhNWFppYVRsdFlrZEdlbUZET1d0TWVtTjRUVVJGZFdNelpHMD0=','0','0','http://s.61baobao.com/common/flash/d/7101.swf','http://www.61baobao.com/common/flash/d/dpic/7101.jpg','http://www.61baobao.com/common/flash/d/pic/7101.jpg','0','三个月以上','0','','0','','0','0','0');");
