E_D("replace into `phome_ecms_game` values('4872','14','0','','','','1','admin','|26|','1','0','1343236835','0','0','0','0','','','4872','0','0','0','0','0','0','卖花姑娘','1343236835','/spic/20120725/6895.jpg','0','1','1343236835','0','3','1','0','','0','','/d/file/swf/6061.swf','667','479','卖花来呦,卖花来呦，<br />朵朵红花多鲜艳，<br />花儿多香,花儿多鲜，<br />美丽的花儿红艳艳，<br />卖了花儿,来呦来呦，<br />治好生病的好妈妈，<br />卖花来呦,卖花来呦，<br />朵朵鲜花红艳艳，<br />从小河边摘来了粉红色的八仙花，<br />从山坡上采来了美丽的金达莱，<br />卖花来呦,卖花来呦，<br />快快来买这束花，<br />让这鲜花和那春光洒满痛苦的胸怀。<br /><br />卖花来呦,卖花来呦<br />花儿好啊红又香<br />朵朵红花卖不完呐<br />滴滴眼泪流不完<br />没有祖国没有权<br />生活之路遇终端<br />在这春暖花开之时<br />终日卖花泪不干<br />卖花来呦,卖花来呦<br />朵朵红花多鲜艳<br />花儿多香,花儿多鲜<br />美丽的花儿红艳艳<br />卖花来呦,卖花来呦<br />花儿好啊红又香<br />朵朵红花卖不完呐<br />滴滴眼泪流不完<br />朵朵红花卖不完呐<br />滴滴眼泪流不完','1','','0','','1','/dpic/20120725/6896.jpg','6061','VERKT2RtSlhNWFppYVRsdFlrZEdlbUZET1d0TWVsbDNUbXBGZFdNelpHMD0=','0','0','http://s.61baobao.com/common/flash/d/6061.swf','http://www.61baobao.com/common/flash/d/dpic/6061.jpg','http://www.61baobao.com/common/flash/d/pic/6061.jpg','0','三个月以上','0','','0','','0','0','0');");
E_D("replace into `phome_ecms_game` values('4876','14','0','','','','1','admin','','1','0','1343236835','0','0','0','0','','','4876','0','0','0','0','0','0','月亮河边的孩子','1343236835','/spic/20120725/6823.gif','0','1','1343236835','0','3','1','0','','0','','/d/file/swf/6577.swf','667','479','一轮明月在天上游荡，<br />青石板的路上，<br />洒满银色的月光。<br />好像是一条，<br />一条月亮河，<br />在我们身旁，<br />悄悄地流淌，<br />我们是一群月亮河边的孩子，<br />望着月亮在幻想。<br />明月穿过云层在游荡，<br />心儿像小船儿，<br />穿过云的波浪，<br />小船儿，载着，<br />载着我们的童年，<br />在月亮河里，<br />飘向那远方，<br />我们是一群月亮河边的孩子，<br />在月亮河畔成长。 ','1','','0','','1','/dpic/20120725/6824.gif','7013','VERKT2RtSlhNWFppYVRsdFlrZEdlbUZET1d0TWVsa3hUbnBqZFdNelpHMD0=','0','0','http://s.61baobao.com/common/flash/d/6577.swf','http://www.61baobao.com/common/flash/d/dpic/6577.gif','http://www.61baobao.com/common/flash/d/pic/6577.gif','0','三个月以上','0','','0','','0','0','0');");
