E_D("replace into `phome_ecms_game` values('5050','14','0','','','','1','admin','','1','0','1343236867','0','0','0','0','','','5050','0','0','0','0','0','0','蚕姑娘','1343236867','/spic/20120725/7211.jpg','0','1','1343236867','0','3','1','0','','0','','/d/file/swf/canguniang.swf','667','479','','1','','0','','1','/dpic/20120725/7212.jpg','5904','VERKT2RtSlhNWFppYVRsdFlrZEdlbUZET0hsTlJFRXpUREpPYUdKdFpERmliV3hvWW0xamRXTXpaRzA9','0','0','http://s.61baobao.com/common/flash/2007/canguniang.swf','http://www.61baobao.com/common/flash/2007/dpic/canguniang.jpg','http://www.61baobao.com/common/flash/2007/pic/1550.jpg','0','三个月以上','0','','0','','0','0','0');");
E_D("replace into `phome_ecms_game` values('5052','14','0','','','','1','admin','','1','0','1343236867','0','0','0','0','','','5052','0','0','0','0','0','0','月亮之上','1343236867','/spic/20120725/7314.jpg','0','1','1343236867','0','3','1','0','','0','','/d/file/swf/5837.swf','667','479','我在仰望 月亮之上,有多少梦想在自由的飞翔,<br />昨天遗忘啊 风干了忧伤,我要和你重逢在那苍茫的路上,<br /><br />生命已被牵引 潮落潮涨,有你的远方 就是天堂.<br />谁在呼唤 情深意长,让我的渴望象白云在飘荡,<br />东边牧马 西边放羊,热辣辣的情歌就唱到了天亮,<br />在日月沧桑后 你在谁身旁,用温柔眼光 让黑夜绚烂.<br /><br />我等待我想象 我的灵魂早已脱僵,<br />马蹄声起马蹄声落 看见的看不见的,<br />瞬间的永恒的 青草长啊大雪飘扬,<br /><br />节奏响起 煽动了想象,让摇曳的身体开始开始思想,<br />马头琴悠扬 马奶酒穿肠,我的爱情奔跑在呼伦贝尔草原上.<br /><br />你的善良 我不能不能抵抗,你的纯洁 将我的心紧紧捆绑,<br />OH 你的笑容 让我找到了最后信仰,<br />美丽的月亮 你让霓虹黯淡无光.','1','','0','','1','/dpic/20120725/7315.jpg','5837','VERKT2RtSlhNWFppYVRsdFlrZEdlbUZET1d0TWVsVTBUWHBqZFdNelpHMD0=','0','0','http://s.61baobao.com/common/flash/d/5837.swf','http://www.61baobao.com/common/flash/d/dpic/5837.jpg','http://www.61baobao.com/common/flash/d/pic/5837.jpg','0','三个月以上','0','','0','','0','0','0');");
